import React from "react";
import img40 from "../images/CINEMA-PARADISO_fq@2x.png";


export default function Footer()
{
    return (
        <>
            <div className="footer">
                <img className="logo" src={img40} alt="no img" />
                <p className="contact">832-969-9683</p>
                <p className="email">boose565@gmail.com</p>
            </div>
        </>
    );
}
